import React from 'react';
import im from "./img/kkk.gif"
// import Button from 'react-bootstrap/Button';

const Home =()=>{

    return(

        <div class="container">
        <div class="row h-100">
            <div class="col-lg-6 col-sm-12 d-flex justify-content-center overflow-hidden order-2 ">
                <div class="d-flex flex-column h-100 justify-content-center m-2">
                    <p class="p1">Your Trusted Development Partner</p>
                    <p class="p2">Your imagination becomes reality</p>
                    <p class="p12">We deliver web and mobile app , Game development services to global businesses. Our User experience approach and project execution processes help you to deliver the right solutions.</p>
                    <button class="Whatwedo">What we do</button>

                </div>

            </div>
            <div class="col-lg-6 col-sm-12 d-flex justify-content-center overflow-hidden order-1">
                <img src="kkk.gif" alt="img" style="width: 100%; height: 100%;"/>
            </div>

        </div>
    </div>
        
    )


}

export default Home;
